description:
Starring: Monique Alexander, Sunny Lane, Jewels Jade, Audrey Lords, Rocco Reed, Danny Mountain, Johnny Castle, Kris Slater, Dale DaBone.

Carrie, Charlotte, Samantha and Miranda are all laughs and cheers over their latest invention and it's not a new type of martini. These ladies were in search of pleasure and they are here to take you on their walk down memory lane as they search for the screaming O!

